nges in responsivity."},"id":"4279","type":"panel.models.markup.HTML"},{"attributes":{"children":[{"id":"4275"},{"id":"4276"}],"margin":[0,0,0,0],"name":"Row00630"},"id":"4274","type":"Row"},{"attributes":{"children":[{"id":"4274"},{"id":"4277"}],"margin":[0,0,0,0],"name":"Column00631"},"id":"4273","type":"Column"},{"attributes":{"data_source":{"id":"4267"},"glyph":{"id":"4268"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"4269"},"view":{"id":"4271"}},"id":"4270","type":"GlyphRenderer"},{"attributes":{"line_color":"darkblue","x":{"field":"x"},"y":{"field":"y"}},"id":"4268","type":"Line"},{"attributes":{},"id":"4283","type":"BasicTickFormatter"},{"attributes":{},"id":"4285","type":"AllLabels"},{"attributes":{"line_alpha":0.1,"line_color":"darkblue","x":{"field":"x"},"y":{"field":"y"}},"id":"4269","type":"Line"},{"attributes":{"source":{"id":"4267"}},"id":"4271","type":"CDSView"},{"attributes":{"align":"center","height":350,"margin":[5,5,5,5],"name":"PNG00625","text":"&amp;lt;img src=&amp;quot;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAlIAAANlCAMAAACACefgAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAMAUExURQAAAEw4ADRVIDxZIExMTGlMADBQlURdIDBVlTBVmTRVkUhhIFBhHDxZjThZmVVlHDhdnUBdiURdhTxdnURdiXldAH1dAF1pHEhhhUxhgWFtGFBlfVVpeWlxGI1pAG11GGlpaV1tdXV1GGVtcXl5FGlxbVV1qnF1aYF9FJl1AHV5YXl5YWF5romBFHl9YX19XY2FFKV9AIGBWX19fYWBWYmBVZWJEJmJEImFVY2FUJGFULKFAKGNEJWJSJWJTJmJSKWRDJmNSJ2NRHWNur6NAI2Nja6VDKWRQH2RvomZfaqVPLaZDK6VOK6VPMaVALqdDLKZOLaZNMKdCLqZNJmZmc6dAL6dLMahCNKdAMKdLMKhLMahKM6lCNqhAJmqjcqlJM6lIM6lJNKqCKWlpdKqHNKqIJWqytaqHOKqANquBN6uBNauHNquGNquHN6uGKWynequAN6yFOayBOKyFOayEOq2ALKysua2EO62AOq2DOq2EPK2AO62DPK6APK6CPa6BLK+qva+BPq+APq+BP++AL6+vv/CALrGssbGxsLOvsrSxtLS0srW5tLaztra2tre6tri1uLi4uLm3ubq5ubq8urq6u7u9u7y7vLy8vL28vL2+vr6+v///wAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA
